import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    Redirect,
  } from "react-router-dom";

import mppNavStyles from "./../../styles/mppNav/mppNav.scss"
import mppHomePage from "./mppSections/mppHomePage";
import mppAboutPage from "./mppSections/mppHomePage";
import mppMedicarePages from "./mppSections/mppMedicarePages";

  const mppNav = () => (

        <div>
          <div className={mppNavStyles}>
            <nav>
              <ul className="nav-items">
                <li className="nav-item">
                  <Link to="/mppHomePage">HOME PAGE</Link>
                </li>
                <li className="nav-item">
                  <Link to="/mppMedicarePages">MEDICARE PAGES</Link>
                </li>

                <li className="nav-item">
                  <Link to="/mppAboutPage">
                    ABOUT PAGE
                  </Link>
                </li>
              </ul>


            </nav>

            <Switch>
              <Route
                exact
                path="/mppHomePage"
                render={() => {
                  return <Redirect to="/mppHomePage" />;
                }}
              />

              <Route exact path="/mppHomePage" component={mppHomePage} />
              <Route path="/mppAboutPage" component={mppAboutPage} />
              <Route path="/mppMedicarePages" component={mppMedicarePages} />

            </Switch>
          </div>
        </div>

    );


  export default mppNav;
